  input: '"TEXT","F3XA",,"Re: FEC letter dated 2/27/03. The credit card payments have
    been corrected. This report also amends the Sanford D. Bishop for Congress contribution
    that was previously reported. That contribution was reported in error. The contribution
    was actually made to Rob Bishop for Congress. Previously, the FEC sent a letter
    dated 2/5/03 that stated that the contribution made to Sanford D. Bishop for Congress
    was an impermissible contribution because it was designated for Primary Debt 2002.
    That letter was addressed and that report amended on 2/20/03. A request for a
    refund was also sent to Sanford D. Bishop for Congress. Because the Sanford D.
    Bishop contribution was made in error and not identified until today, ARMPAC has
    notified Sanford D. Bishop for Congress of the error and we are also amending
    our July 2002 report to reflect the correct contribution made to Rob Bishop for
    Congress. "'
